const initState = {}

const auditoriaReducer = (state = initState, action) => {
    switch (action.type) {
        case 'CREATE_AUDITORIA_SUCCESS':
            console.log('create auditoria success');
            return state;
        case 'CREATE_AUDITORIA_ERROR':
            console.log('create auditoria error');
            return state;
        default:
            return state;
    }
};

export default auditoriaReducer;
